6-19 10:29:11','2020-06-19 10:29:11',NULL),(443,'ОСОБЕННОСТИ ПРОВЕДЕНИЯ ВСТУПИТЕЛЬНЫХ ИСПЫТАНИЙ ДЛЯ ИНВАЛИДОВ И ЛИЦ С ОГРАНИЧЕННЫМИ ВОЗМОЖНОСТЯМИ ЗДОРОВЬЯ','smGhs0FBLYiGaitRqKfm9Z2KoHhv5EeFhuk0wBgS.pdf',0,'Особенности проведения вступительных испытаний.pdf','file','4kfs18q8yboi94gx0sbfjh',NULL,442,'2020-06-19 10:29:11','2020-06-19 10:29:11','pdf'),(444,'ИНФОРМАЦИЯ О НЕОБХОДИМОСТИ (ОТСУТСТВИИ НЕОБХОДИМОСТИ) ПРОХОЖДЕНИЯ ПОСТУПАЮЩИМИ ОБЯЗАТЕЛЬНОГО ПРЕДВАРИТЕЛЬНОГО МЕДИЦИНСКОГО ОСМОТРА (ОБСЛЕДОВАНИЯ)',NULL,7,NULL,'files',NULL,13,NULL,'2020-06-19 10:31:06','2020-06-19 10:31:06',NULL),(445,'ИНФОРМАЦИЯ О НЕОБХОДИМОСТИ (ОТСУТСТВИИ НЕОБХОДИМОСТИ) ПРОХОЖДЕНИЯ ПОСТУПАЮЩИМИ ОБЯЗАТЕЛЬНОГО ПРЕДВАРИТЕЛЬНОГО МЕДИЦИНСКОГО ОСМОТРА (ОБСЛЕДОВАНИЯ)','qqbobLAyW2cMcRATV1gTrAQMNWqMbGrIb4oXbAnx.pdf',0,'Информация о  медосмотре.pdf','file','1auwefsq99ofgvnckbs9e',NULL,444,'2020-06-19 10:31:06','2020-06-19 10:31:06','pdf'),(446,'ИНФОРМАЦИЯ О НАЛИЧИИ ОБЩЕЖИТИЯ И КОЛИЧЕСТВЕ МЕСТ В ОБЩЕЖИТИЯХ, ВЫДЕЛЯЕМЫХ ДЛЯ ИНОГОРОДНИХ ПОСТУПАЮЩИХ',NULL,8,NULL,'files',NULL,13,NULL,'2020-06-19 10:32:12','2020-06-19 10:32:12',NULL),(447,'ИНФОРМАЦИЯ О НАЛИЧИИ ОБЩЕЖИТИЯ И КОЛИЧЕСТВЕ МЕСТ В ОБЩЕЖИТИЯХ, ВЫДЕЛЯЕМЫХ ДЛЯ ИНОГОРОДНИХ ПОСТУПАЮЩИХ','ZC2MelSaWfLNJ5ITwaNnFMsyqhdArXoudQDopkvq.pdf',0,'Информация об общежитиях.pdf','file','pnrmbeh0vmdzk8x16e7749',NULL,446,'2020-06-19 10:32:12','2020-06-19 10:32:12','pdf'),(448,NULL,NULL,9,NULL,'files',NULL,13,NULL,'2020-06-19 10:32:12','2020-06-19 10:32:12',NULL),(449,'Изменения в Правила приема от 18.06.2020','M8HdwXAKi2Sf7Dut0ApVb0Eo4Uhzc9prsNTx3qkI.pdf',1,'Изменения в Правила ВО_от 18.06.2020.pdf','file','kqodotx9ed99xlh44c78rb',NULL,2,'2020-06-19 10:33:46','2020-06-19 10:34:02','pdf'),(451,'Договор_Высшее образование','HT0KyxYMBnA7USX76Ipe2UUYDsQOWq3yBLOPcAkE.pdf',1,'Договор ВО РФ 2020-2021.pdf','file','et5ju8pqyxj9m79fzzaie',NULL,143,'2020-06-19 14:13:45','2020-06-19 14:13:45','pdf'),(452,'Изменения в Правила приема от 18.06.2020','usPkYqJc0XCB9umGzAYaWQOy1IkS8dQLqKiD3t3y.pdf',1,'Изменения в Правила ВО_от 18.06.2020.pdf','file','tqn0lka38eiqtcpevio2a',NULL,355,'2020-06-19 14:32:10','2020-06-19 14:33:21','pdf'),(424,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,2,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по ссылке: https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p class=\"ql-align-justify\">	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p class=\"ql-align-justify\">	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p class=\"ql-align-justify\">	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p class=\"ql-align-justify\">	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p class=\"ql-align-justify\">	<strong>5.</strong> &nbsp;Ход проведения вступительных испытаний: </p><p class=\"ql-align-justify\">	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p class=\"ql-align-justify\">	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p class=\"ql-align-justify\">	<strong>6.</strong> &nbsp;Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p class=\"ql-align-justify\">	<strong>7.</strong> &nbsp;При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p class=\"ql-align-justify\">	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong>8.</strong> &nbsp;В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p class=\"ql-align-justify\">	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p class=\"ql-align-justify\">	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,51,NULL,'2020-06-19 07:52:38','2020-06-19 07:52:38',NULL),(425,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,3,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p class=\"ql-align-justify\"><strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p class=\"ql-align-justify\">	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p class=\"ql-align-justify\">	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p class=\"ql-align-justify\">	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p class=\"ql-align-justify\">	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p class=\"ql-align-justify\">	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:53:15','2020-06-19 07:53:15',NULL),(2,' ПРАВИЛА ПРИЕМА, УТВЕРЖДЁННЫЕ РЕШЕНИЕМ УЧЕНОГО СОВЕТА УНИВЕРСИТЕТА, НА 2020 ГОД',NULL,0,NULL,'files',NULL,1,NULL,'2020-01-28 13:41:31','2020-05-29 10:48:55',NULL),(61,'Приложение 5','SGZnSkj9rMGbyYQvfrs5CRJNMpdemOZf0kce0pLh.pdf',6,'Приложение 5.pdf','file','6jzuflx7f4fq9hqnluy0t',NULL,2,'2020-05-29 10:48:55','2020-06-19 10:34:08','pdf'),(62,'Приложение 6','Nbt5wuhUMNfTFyRGeg36W8w9dwqylavOVMcks4hj.pdf',7,'Приложение 6.pdf','file','rwe6d4afroffdjwewy1ra',NULL,2,'2020-05-29 10:48:55','2020-06-19 10:33:49','pdf'),(63,'Приложение 4','UMDILsxKzYchwdHcz1hE06pCQJCCfiSNy8XLLwNo.pdf',5,'Приложение 4.pdf','file','fbzedjneyuhm14h6u8iil',NULL,2,'2020-05-29 10:49:44','2020-06-19 10:34:08','pdf'),(60,'Приложение 3','WzKHPOKqKN9W5VavlsN0DBvjHMHoyAUYzofKL8M7.pdf',4,'Приложение 3.pdf','file','ic7awnibwk9ai0j80c5q7i',NULL,2,'2020-05-29 10:48:55','2020-06-19 10:33:54','pdf'),(10,'ОБ УТВЕРЖДЕНИИ ПЕРЕЧНЯ ОЛИМПИАД',NULL,0,NULL,'files',NULL,5,NULL,'2020-01-31 10:24:04','2020-02-03 06:25:18',NULL),(12,'Перечень олимпиад','bm7rr2pe3zRpARuiHIfmVM20i9MvnkxnB3KlqVFx.pdf',0,'Перечень олимпиад.pdf','file','a06zmrmrdalee3c2vvt3k7',NULL,10,'2020-01-31 10:25:09','2020-02-03 06:25:18','pdf'),(17,'',NULL,0,'<p>В связи с угрозой распространения новой коронавирусной инфекции (COVID-19)&nbsp;«Дни открытых дверей» институтов и факультетов не проводятся. Интересующую информацию можно найти на сайтах институтов и факультетов (раздел «Университет» по <a href=\"https://mrsu.ru/ru/struct/\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>). Также вы можете задать вопросы на адреса электронной почты соответствующих институтов и факультетов или приемной комиссии университета. </p><p><br></p>','text',NULL,3,NULL,'2020-02-03 06:22:28','2020-06-02 14:03:45',NULL),(76,NULL,NULL,0,'','text',NULL,21,NULL,'2020-05-29 16:45:13','2020-05-29 16:50:45',NULL),(18,'ОБ УТВЕРЖДЕНИИ ДОПОЛНИТЕЛЬНОГО ПЕРЕЧНЯ ОЛИМПИАД',NULL,1,NULL,'files',NULL,5,NULL,'2020-02-03 06:25:54','2020-02-03 06:25:54',NULL),(19,'Приказ о доп. перечне олимпиад','v9mPOa78ww28fMXiDd5WH0Qb4kbxcXJ9w00Biwgh.pdf',0,'Приказ о доп. перечне олимпиад.pdf','file','suxhyr665aapln3aff2xur',NULL,18,'2020-02-03 06:25:54','2020-02-03 06:25:54','pdf'),(20,'ПОЛОЖЕНИЯ',NULL,2,NULL,'files',NULL,5,NULL,'2020-02-03 06:27:34','2020-02-03 06:27:34',NULL),(21,' Положение о Открытой олимпиаде по Физике и Химии','YaY0ZkSDWpV9gUi1BzkUQ53ITDkikuTN2IO37RDA.pdf',0,'Положение о Открытой олимпиаде по Физике и Химии.pdf','file','twgnfl71xcnvuh7yne88f',NULL,20,'2020-0